article_content:
집에 소프시스 제품이 몇가지 있기도 하고.. 테이블 다리가 세개라 튼튼해보여서 구매했습니다
근데 며칠 써본결과 솔직히 많이 실망했네요..
우선 젤 심한건 나사를 확실히 꽉 조여줬는데도 팔을 올렸다 떼면 삑삑소리가 거슬릴정도로 심하게 납니다
그리고 아이스커피를 올려놨었는데 컵 바깥에 생긴 물이 흘러 테이블 틈이 벌어졌어요;;
처음에 물 흘린부분이 벌어지더니 좀 지나니까 그 근처 테두리가 다 일어섰습니다
실제로 보면 눈에 확 띄는데 사진은 별거 아닌것처럼 나오네요;

화이트 라고해서 테이블이 흰색인줄 알고 주문했는데 다리가 흰색이란 뜻이네요;;
그리고 메이드 인 차이나여서 그런건가 모퉁이 부분이 이미 살짝 벗겨져서 왔고, 다리 구멍부분에 검은색 모래같은 먼지들이 쌓여있고 녹슨것처럼 흰다리 부분에 갈색으로 살짝살짝 지저분한 변색이 있어요~
뭐 그냥 싼가격에 막 쓰기 용도로는 좋겠네요.
